10.body:
衛生性(Hygiene)はマクロに関する重要な概念です。 衛生性とは、マクロが周辺のコンテキストに影響を与えたり逆に影響受けたりすることなく、自身の構文コンテキストの中で動作する能力を指します。 言いかえれば、任意の構文拡張の呼び出しは周辺のコンテキストに干渉するべきではないということを意味します。 理想的には、Rustのすべての構文拡張は完全に衛生的であってほしいところですが、残念ながらそうではないので、十分衛生的ではない構文拡張を書くことがないよう注意を払うべきです。 ここから一般的な衛生性の概念の説明に入ります。なお、これについてはRustが提供する別の種類の構文拡張の衛生性に関する章でも言及します。 衛生性は主に構文拡張が出力する識別子とパス(path)に影響します。 簡単にいうと、構文拡張が生成した識別子を、構文拡張を呼び出した環境から参照できないとき、構文拡張はその識別子に関して衛生的であるといえます。 同様に、構文拡張の内部で利用されている識別子が、構文拡張の外部で定義されたものを参照できないときも、構文拡張は衛生的であるといえます。 Note : 「生成」「利用」という用語は、識別子がどの位置に出現しているかを表すものです。 struct Foo {} における Foo や let foo = …; における foo は、その名前のもとで新しい何かを導入したという意味で「生成」されたといえます。 一方で fn foo(_: Foo) {} における Foo や foo + 3 における foo は、既存の何かを参照するという意味で「利用」だといえます。 例を挙げて説明するのが一番でしょう。 make_local という構文拡張があって、let local = 0; に展開されるとしましょう。これは local という識別子を 生成 します。 次のようなコード片を考えます: make_local!();
assert_eq!(local, 0); もし assert_eq!(local, 0); における local が、この構文拡張が定義したローカル変数に解決されるならば、この構文拡張は(少なくともローカルな名前・束縛(bindings)に関していえば)衛生的ではないということになります。 今度は use_local という構文拡張があって、local = 42; に展開されるとしましょう。これは localという識別子を 利用 します。 次のようなコード片を考えます: let mut local = 0;
use_local!(); もし呼び出された構文拡張の内部の local が、その呼び出しの前に定義されたローカル変数に解決されるのであれば、この構文拡張はやはり衛生的ではないということになります。 以上は衛生性の一般概念への比較的短い導入です。 衛生性については、 macro_rules! の衛生性 と 手続き的マクロの衛生性 の章で、各々に固有の性質に言及しながら、より深いところまで説明します。

11.body:
rustc は構文拡張全般をデバッグするためのツールをいくつか提供しています。さらに、宣言的マクロと手続き的マクロのそれぞれに合わせたより特化したツールも提供します。 普段は展開後のコードを見ることはないため、構文拡張の 展開結果 がよく分からなくなることがあります。 ありがたいことに、rustc のunstableな -Zunpretty=expanded 引数を使って展開後のコードを見ることができます。 次のようなコードがあるとします: // Shorthand for initializing a `String`.
// `String` 初期化の略記法
macro_rules! S { ($e:expr) => {String::from($e)};
} fn main() { let world = S!("World"); println!("Hello, {}!", world);
} これを次のコマンドでコンパイルすると: rustc +nightly -Zunpretty=expanded hello.rs 次のような結果が得られます(結果を整形しています): #![feature(prelude_import)]
#[prelude_import]
use std::prelude::rust_2018::*;
#[macro_use]
extern crate std;
// Shorthand for initializing a `String`.
// `String` 初期化の略記法
macro_rules! S { ($e : expr) => { String :: from($e) } ; } fn main() { let world = String::from("World"); { ::std::io::_print( ::core::fmt::Arguments::new_v1( &["Hello, ", "!\n"], &match (&world,) { (arg0,) => [ ::core::fmt::ArgumentV1::new(arg0, ::core::fmt::Display::fmt) ], } ) ); };
} 構文拡張のデバッグを支援する手段を提供しているのは rustc だけではありません。 dtolnay氏 が cargo-expand という名前の素晴らしい cargo プラグインを制作しています。これは基本的には前述した -Zunpretty=expanded オプションの単なるラッパーです。 Playground を利用することもできます。右上にある TOOLS ボタンをクリックすると、構文拡張を展開するオプションが選択できます。

15.body:
macro_rules!マクロが呼び出されると、macro_rules!のインタプリタはルールを1つ1つ定義順に調べていきます。 各ルールについて、インタプリタは入力トークン木の内容とルールの「マッチパターン」のマッチングを試みます。 マッチパターンが入力の 全体 に一致している場合のみ、マッチしたとみなされます。 入力とマッチパターンがマッチしたら、マクロの呼び出しを「展開形」で置き換えます。マッチしなければ、次のルールを試します。 どのルールにもマッチしなかった場合、展開はエラーとともに失敗します。 最も単純な例は空のマッチパターンです: macro_rules! four { () => { 1 + 3 };
} これは、入力が同様に空のとき、かつそのときに限りマッチします( 例 : four!(), four![], four!{})。 関数形式マクロを呼び出す際に用いるグルーピング用トークン [1] はマッチ対象 ではない ことに注意してください。実際のところ、それらのトークンはそもそも入力として渡されません。 つまり、上記のマクロをfour![]のように呼び出しても、やはりマッチします。 入力トークン木の 中身 だけが考慮されるということです。 訳注 : マクロ呼び出しにおける一番外側のかっこのこと。 マッチパターンには生の(literal)トークン木を含めることもできます。生のトークン木にマッチさせるには、入力が厳密に一致している必要があります。 これを行うには、単にトークン木をそのまま書けばよいです。 例えば、4 fn ['spang "whammo"] @_@という並びにマッチさせたければ、次のように書けます: macro_rules! gibberish { (4 fn ['spang "whammo"] @_@) => {...};
} トークン木は、書けるものならなんでも使えます。

16.body:
マッチパターンはキャプチャを含むこともできます。 キャプチャは、入力に対する概括的な文法上のカテゴリに基づくマッチングを可能にします。その結果はメタ変数(metavariable)に捕捉され、出力においてメタ変数を捕捉された中身に置換することができます。 キャプチャはドル記号($)に続けて識別子、コロン(:)、そしてフラグメント指定子(fragment-specifier)とも呼ばれるキャプチャの種類という形で書きます。フラグメント指定子は以下のどれかでなければなりません: block : ブロック (波かっこで囲まれた、文や式からなるかたまり) expr : 式 (expression) ident : 識別子 (予約語を含む) item : アイテム (関数、構造体、モジュール、implなど) lifetime : ライフタイム (例: 'foo, 'static, ...) literal : リテラル (例: "Hello World!", 3.14, '🦀', ...) meta : メタアイテム。#[...] や #![...] といった属性の中にくるもの pat : パターン path : パス (path) (例: foo, ::std::mem::replace, transmute::<_, int>, …) stmt : 文 (statement) tt : 単一のトークン木 ty : 型 vis : 可視性修飾子(visibility qualifier)。空でもよい (例: pub, pub(in crate), ...) フラグメント指定子のより詳しい説明を見るには、 フラグメント指定子 の章を参照してください。 例えば、以下のmacro_rules!マクロは、入力を式として$eという名前のメタ変数にキャプチャします: macro_rules! one_expression { ($e:expr) => {...};
} これらのメタ変数はRustコンパイラのパーサを活用しており、そのため常に「正しい」ことが保証されています。 exprのメタ変数は 常に 、コンパイル時のRustバーションにおける完全かつ妥当な式をキャプチャします。 生のトークン木とメタ変数を組み合わせて使うこともできますが、一定の制限( メタ変数と展開・再考 で説明します)があります。 メタ変数を参照するには単に$nameと書きます。変数の型はマッチパターンの中で指定済みのため書く必要はありません。例えば次のようになります: macro_rules! times_five { ($e:expr) => { 5 * $e };
} マクロの展開と同様に、メタ変数は完全な抽象構文木のノードとして置換されます。 これは、たとえメタ変数$eにどんなトークンが捕捉されているとしても、単一の完全な式として解釈されるということを意味します。 一つのマッチパターンに複数のメタ変数を書くことができます: macro_rules! multiply_add { ($a:expr, $b:expr, $c:expr) => { $a * ($b + $c) };
} また、一つのメタ変数を展開形の中で何度でも使うことができます: macro_rules! discard { ($e:expr) => {};
}
macro_rules! repeat { ($e:expr) => { $e; $e; $e; };
} さらに、 $crate という特別なメタ変数があり、現在のクレートを参照するのに使えます。

17.body:
マッチパターンは「繰り返し」を含むことができます。これによりトークンの列へのマッチングが可能になります。 繰り返しは $ ( ... ) sep rep という一般形式を持ちます。 $ は文字通りのドル記号のトークン。 ( ... ) は繰り返し対象となるかっこで括られたマッチパターン。 sep は 省略可能 な区切りのトークン。区切り文字(delimiter) [2] や繰り返し演算子は使えない。よく使われるのは , や ; 。 rep は 必須 の繰り返し演算子。現時点で以下のものが使える: ?: 最大1回の繰り返し *: 0回以上の繰り返し +: 1回以上の繰り返し ?は最大1回の出現を表すので、区切りトークンと一緒に使うことはできない。 訳注 : ここでの区切り文字(delimiter)は、いわゆる「かっこ」に使われる文字: ( ) [ ] { } を指す。 繰り返しの中では、生のトークン木、メタ変数、任意にネストした他の繰り返しを含む、任意の正当なマッチパターンを使えます。 繰り返しは展開形の中でも同じ構文を用います。繰り返されるメタ変数は展開形の中の繰り返しの内部からしかアクセスできません。 例えば、以下は各要素を文字列にフォーマットするMBEマクロです。 0個以上のコンマ区切りの式にマッチし、ベクタを生成する式に展開されます。 macro_rules! vec_strs { ( // Start a repetition: // 繰り返しの開始: $( // Each repeat must contain an expression... // 各繰り返しは式を含み... $element:expr ) // ...separated by commas... // ...コンマで区切られ... , // ...zero or more times. // ...0回以上繰り返される * ) => { // Enclose the expansion in a block so that we can use // multiple statements. // 複数の式を使うため、展開形をブロックで囲む { let mut v = Vec::new(); // Start a repetition: // 繰り返しの開始: $( // Each repeat will contain the following statement, with // $element replaced with the corresponding expression. // 各繰り返しは次のような文に展開される。ここで $element は対応する式に置き換えられる v.push(format!("{}", $element)); )* v } };
} fn main() { let s = vec_strs![1, "a", true, 3.14159f32]; assert_eq!(s, &["1", "a", "true", "3.14159"]);
} すべてのメタ変数が同じ回数だけ繰り返される場合に限り、一つの繰り返しの中で複数のメタ変数を繰り返すことができます。 よって、次のようなマクロ呼び出しは動作します: macro_rules! repeat_two { ($($i:ident)*, $($i2:ident)*) => { $( let $i: (); let $i2: (); )* }
} repeat_two!( a b c d e f, u v w x y z ); しかしこれは動作しません: # macro_rules! repeat_two {
# ($($i:ident)*, $($i2:ident)*) => {
# $( let $i: (); let $i2: (); )*
# }
# } repeat_two!( a b c d e f, x y z ); これは次のようなエラーで失敗します。 error: meta-variable `i` repeats 6 times, but `i2` repeats 3 times --> src/main.rs:6:10 |
6 | $( let $i: (); let $i2: (); )* | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^

21.body:
たいてい、新しい macro_rules! マクロの実装に取りかかるとき、私が初めにするのはその呼び出し方を決めることです。 今回のケースでは、最初の試行は次のようなものになりました: let fib = recurrence![a[n] = 0, 1, ..., a[n-2] + a[n-1]]; for e in fib.take(10) { println!("{}", e) } これをもとに、実際の展開形について確信は持てなくとも、macro_rules! マクロがどのように定義されるべきかを考えてみることはできます。 入力の構文をパースする方法を思いつけないのであれば、構文を変更する必要があるかもしれないということなので、これは有用な考え方です。 macro_rules! recurrence { ( a[n] = $($inits:expr),+ , ... , $recur:expr ) => { /* ... */ };
}
# fn main() {} この構文は見慣れないものだと思いますので、少し説明させてください。 これは recurrence! という名前の、 macro_rules! のシステムを使った構文拡張の定義になります。 この macro_rules! マクロはただ一つの構文ルールを持っています。 そのルールは、呼び出しの入力が次のものに一致しなければならないというものです: リテラルトークンの列 a [ n ] = , を区切りとする、1回以上 (+) の妥当な 式 の 繰り返し ($( ... ))。この式は メタ変数 inits に捕捉される ($inits:expr) リテラルトークンの列 , ... , 妥当な 式 。この式は メタ変数 recur に捕捉される ($recur:expr) 結局、このルールは、 もし 入力がこのルールに一致したら、マクロの呼び出しを /* ... */ というトークンの列で置き換えよ、ということを表しています。 inits は、その名前が示唆するように、最初や最後だけではなく、その位置にある すべての 式を含むことに注意してください。 さらにいえば、inits は、それらの式を不可逆的にまとめてペーストするような形ではなく、 列として 捕捉します。 また、+ の代わりに * を使えば「0回以上」の繰り返しを、?を使えば「任意」、つまり「0回か1回」の繰り返しを表せます。 練習として、先に挙げた入力をこのルールに与えてみて、どのように処理されるか見てみましょう。 「位置」欄では、次に構文パターンのどの部分がマッチングされるかを「 ⌂ 」で示しています。 ある状況では、マッチング対象となる「次」の要素の候補が複数存在することがあるのに注意してください。 「入力」欄は、まだ消費されていないトークンです。 inits・recur 欄はそれらに捕捉されている内容です。 位置 入力 inits recur a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ a[n] = 0, 1, ..., a[n-2] + a[n-1] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ [n] = 0, 1, ..., a[n-2] + a[n-1] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ n] = 0, 1, ..., a[n-2] + a[n-1] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ] = 0, 1, ..., a[n-2] + a[n-1] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ = 0, 1, ..., a[n-2] + a[n-1] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ 0, 1, ..., a[n-2] + a[n-1] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ 0, 1, ..., a[n-2] + a[n-1] a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ , 1, ..., a[n-2] + a[n-1] 0 Note: ここには2つの ⌂ がある。これは次の入力トークンが、繰り返しの要素間のコンマ区切りか、繰り返しの後のコンマのどちらかにマッチしうるため。 マクロシステムは、どちらに従うべきかが確定するまでの間、両方の可能性を追跡する。 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ 1, ..., a[n-2] + a[n-1] 0 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ ⌂ , ..., a[n-2] + a[n-1] 0, 1 Note: 3つめの取り消し線つきのマーカーは、最後のトークンの消費の結果、マクロシステムがありうる選択肢の1つをふるい落としたことを表す。 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ ..., a[n-2] + a[n-1] 0, 1 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ ⌂ , a[n-2] + a[n-1] 0, 1 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ a[n-2] + a[n-1] 0, 1 a[n] = $($inits:expr),+ , ... , $recur:expr ⌂ 0, 1 a[n-2] + a[n-1] Note: このステップは、コンパイラが持つ「妥当な式の構成要素」に関する知識を用いて、$recur:exprのような束縛が式全体を消費することを明確にする。 後述するように、他の言語要素に対してもこれを行うことができる。 ここで重要なのは、マクロシステムが、入力として与えられたトークンたちを所与のルールに対してインクリメンタルにマッチングを 試みる ということです。 「試みる」という部分については後で補足します。 さて、最後の、完全に展開された形を書きはじめましょう。 この展開に対しては、次のようなものが求められています: let fib = { struct Recurrence { mem: [u64; 2], pos: usize, } これは実際のイテレータ型になるべきものです。 mem は漸化式を計算するのに必要となる、直近の数個の値を保持するメモバッファになります。 pos は n の値を追跡するための変数です。 余談 : u64 は、数列の要素を表すのに「十分大きな」型として選びました。 これが 他の 数列に対して上手くいくかを心配する必要はありません。きっと上手くいきますよ。 impl Iterator for Recurrence { type Item = u64; fn next(&mut self) -> Option<Self::Item> { if self.pos < 2 { let next_val = self.mem[self.pos]; self.pos += 1; Some(next_val) 数列の初期値を生成する分岐が必要です。難しいところはないでしょう。 } else { let a = /* something */; let n = self.pos; let next_val = a[n-2] + a[n-1]; self.mem.TODO_shuffle_down_and_append(next_val); self.pos += 1; Some(next_val) } } } こちらはちょっと難しいです。aを厳密にどう定義するかについては、あとで見ていきます。 TODO_shuffle_down_and_append も仮実装になっています。 ここには、next_val を配列の末尾に配置し、残りの要素を1つずつずらし、最初の要素を削除するものが必要です。 Recurrence { mem: [0, 1], pos: 0 }
}; for e in fib.take(10) { println!("{}", e) } 最後に、この新しい構造体のインスタンスを返します。これに対して反復処理を行うことができます。 まとめると、展開形の全容は以下のようになります: let fib = { struct Recurrence { mem: [u64; 2], pos: usize, } impl Iterator for Recurrence { type Item = u64; fn next(&mut self) -> Option<u64> { if self.pos < 2 { let next_val = self.mem[self.pos]; self.pos += 1; Some(next_val) } else { let a = /* something */; let n = self.pos; let next_val = (a[n-2] + a[n-1]); self.mem.TODO_shuffle_down_and_append(next_val.clone()); self.pos += 1; Some(next_val) } } } Recurrence { mem: [0, 1], pos: 0 }
}; for e in fib.take(10) { println!("{}", e) } 余談 : そう、これはマクロの呼び出しのたびに別の Recurrence 構造体とその実装を定義することを意味します。 ほとんどの部分は最終的なバイナリ上では最適化されるでしょう。 展開形を書きながら、それを見直すのも有用です。 展開形の中に、呼び出しのたびに異なるべき何かがあって、それがマクロが実際に受け入れる構文の中に ない のであれば、それをどこに導入するか考える必要があります。 今回の例では、u64を追加しましたが、それはユーザにとってもマクロ構文中にも必ずしも必要なものではありません。修正しましょう。 macro_rules! recurrence { ( a[n]: $sty:ty = $($inits:expr),+ , ... , $recur:expr ) => { /* ... */ };
} /*
let fib = recurrence![a[n]: u64 = 0, 1, ..., a[n-2] + a[n-1]]; for e in fib.take(10) { println!("{}", e) }
*/
# fn main() {} 新たにメタ変数 sty を追加しました。これは型にマッチします。 余談 : メタ変数のコロン以降の部分は、マッチする構文の種類を表します。 よく使われるのは item, expr, そして ty です。 詳しい説明は 「マクロ: 形式的説明」 の章の 「メタ変数」の項目 をご覧ください。 もう一つ知っておくべきことがあります。言語の将来の変化に備える意味で、コンパイラはマッチパターンの種類に応じて、その あとに 続けられるトークンの種類に制限を設けています。 概して、これは式や文にマッチングさせようとしたときに問題になります。 これらのあとに続けられるのは =>, ,, ; のみ となります。 完全なリストは 「枝葉末節」の章の「メタ変数と展開・再考」の節 にあります。

