} この結果からいくつかのことがいえます。 まず、すぐにわかることは、stmt フラグメントが末尾のセミコロンを捕捉しないにもかかわらず、必要なところにセミコロンが出力されているということです。これは、すでに文の末尾にセミコロンがあったとしても同様です。 この理由は単純で、セミコロンはそれ自体がすでに、stmt フラグメントが捕捉する妥当な文だからです。 よって、このマクロは8回ではなく10回捕捉を行っているのです！ これは複数回の繰り返しを行い、それらを一つの繰り返し展開形として展開する際に重要となりえます。そのようなケースでは繰り返しの回数が一致している必要があるためです。 もう一つわかることは、アイテム文struct Foo; の末尾のセミコロンにマッチしているということです。そうでなければ、他の場合のように余計なセミコロンが出てくるはずです。 前述したように、セミコロン必須のアイテム文に関しては末尾のセミコロンがマッチ対象になるため、筋は通っています。 最後に、単独のブロック式や制御フロー式のみから構成される場合を除き、式が末尾のセミコロンつきで出力され直していることが観察できます。 ここで言及したことの詳細を知るには、 リファレンス をあたってください。 幸い、これらの詳細は通常まったく重要ではありません。先述したように繰り返しに関する小さな例外はありますが、それだけではそこまで頻繁には問題にならないはずです。 デバッグを行う際のコツについては デバッグの章 を参照。

