TT munchers are inherently quadratic. Consider a TT muncher rule that consumes one token tree and then recursively calls itself on the remaining input. If it is passed 100 token trees: The initial invocation will match against all 100 token trees. The first recursive invocation will match against 99 token trees. The next recursive invocation will match against 98 token trees. And so on, down to 1. This is a classic quadratic pattern, and long inputs can cause macro expansion to blow out compile times. Try to avoid using TT munchers too much, especially with long inputs. The default value of the recursion_limit attribute is a good sanity check; if you have to exceed it, you might be heading for trouble. If you have the choice between writing a TT muncher that can be called once to handle multiple things, or a simpler macro that can be called multiple times to handle a single thing, prefer the latter. For example, you could change a macro that is called like this: # macro_rules! f { ($($tt:tt)*) => {} }
