Hygiene is by far the biggest difference between the two declarative macro systems. Unlike macro_rules which have mixed site hygiene , macro have definition site hygiene, meaning they do not leak identifiers outside of their invocation. As such the following compiles with a macro_rules macro, but fails with a macro definition: #![feature(decl_macro)]
// try uncommenting the following line, and commenting out the line right after macro_rules! foo {
// macro foo { ($name: ident) => { pub struct $name; impl $name { pub fn new() -> $name { $name } } }
} foo!(Foo); fn main() { // this fails with a `macro`, but succeeds with a `macro_rules` let foo = Foo::new();
} There may be plans to allow escaping hygiene for identifiers(hygiene bending) in the future.

