The quote crate mainly exposes just one macro, the quote! macro. This little macro allows you to easily create token streams by writing the actual source out as syntax while also giving you the power of interpolating tokens right into the written syntax. Interpolation can be done by using the #local syntax where local refers to a local in the current scope. Likewise #( #local )* can be used to interpolate over an iterator of types that implement ToTokens , this works similar to declarative macro_rules! repetitions in that they allow a separator as well as extra tokens inside the repetition. let name = /* some identifier */;
let exprs = /* an iterator over expressions tokenstreams */;
let expanded = quote! { impl SomeTrait for #name { // #name interpolates the name local from above fn some_function(&self) -> usize { #( #exprs )* // #name interpolates exprs by iterating the iterator } }
}; This a very useful tool when preparing macro output avoiding the need of creating a token stream by inserting tokens one by one. Note : As stated earlier, this crate makes use of proc_macro2 and thus the quote! macro returns a proc-macro2::TokenStream.
